INSERT INTO `PRODUCTS` VALUES (2,'2021-03-04','This black and gray joggers are a Raikago favorite! \"Jogā\" joggers are a very unique and fashionable jogger that come in a loose comfortable fit, available in sizes S-XXL',49,'\"JOGĀ\" MEN\'S JOGGER PANTS',91.95,50,75.99,46.89),(4,'2021-03-04','Shop these techwear accessorise favorite\'s! A one size fits all that perfect for casual daily wear. ',10,'TECHWEAR BUCKET HAT',48.4,15,40,43.56),(5,'2021-03-04','Shop these reflective, futuristic joggers that are great for a casual day fit. See the size chart to get your specific size! ',0,'REFLECTIVE TECHWEAR BLACK PANTS FOR MEN',98,50.2,80.99,98),(6,'2021-03-04','This causal Graphic T-Shirt is perfect for any day of the week. Our vibrate shirt comes in a bright white and bold black. This top can be worn by both men and women. ',15,'\"JAPANESE DEVIL\" GRAPHIC T-SHIRT',39.92,10,32.99,33.93),(7,'2021-03-04','These army cargo pants are perfect for women of all sizes. They are available in a bold black and army green. Our \"Sada\" joggers come in a loose comfortable fit, featuring buckle straps, large pockets and made with 100% cotton material.',21,'\"SADA\" HIGH WAIST CARGO',84.7,35.99,70,66.91),(8,'2021-03-04','This Japanese cherry blossom is a beautiful hoodie that comes in both black, white, and pink. Made out of 100% quality cotton material. A stylish hoodie for both men and women.',0,'JAPANESE CHERRY BLOSSOM HOODIE',108.89,49.99,89.99,108.89),(9,'2021-03-04','These all-new streetwear pants are perfect for any casual day out. They come with a cut out along the lower half of the legs with lace-up strings. This outfit is a perfect addition to your closet. ',0,'\"TŌRI\"WOMEN\'S LACE UP PANTS',96.79,40,79.99,96.79),(10,'2021-03-04','Shop this handy bag for all your future endeavors! Available in both black and white. ',0,'\"DARK MASS\" TECHWEAR BACKPACK',60.49,30,49.99,60.49),(11,'2021-03-04','Shop These edgy cut-out techwear pants.  These women joggers are an edgy techwear addition to anyone\'s closet! ',25,'HIGH WAIST CARGO PANTS',72.6,15,60,54.45),(12,'2021-03-04','Shop this sleek jacket for the chiller season. You can wear this jacket in a bright white or bold black. ',5,'TECHWEAR LEATHER JACKET',181.5,80,150,172.43);
